import React from 'react';
import {Typography} from "@material-ui/core";


const AskQuestion = () => {
    const parameters = React.useState({
        title : '',
        subtitle : '',
        category : ''
    });

    return (
        <div>
            <Typography component="h1">Ask a question</Typography>
            <form className="form">

                <input className="form-input" placeholder="Enter title" />

                <input className="form-input" placeholder="Enter question" />

                <input className="form-input" placeholder="Enter Category" />
            </form>
        </div>
    )
}

export default AskQuestion;
